import Layout from '../components/layout'

function HomePage() {
  return (
    <Layout>
      <h1>Welcome to Next.js!</h1>

    </Layout>
  )
}
export async function getStaticProps(context) {
  //data fetch
  const data = await fetch('https://rickandmortyapi.com/api/character/')
  return {
    props: {
      caracter: []
    }
  }
}
export default HomePage
